INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "東山奈央", "ヒヨリ", 27, "獣人族", 44, 100101, "A", 155, 16, 2, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "人助けが大好き！　前向き格闘娘", 8, "人助け、応援", "トゥインクルウィッシュ");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "種田梨沙", "ユイ", 5, "ヒューマン", 47, 100201, "O", 158, 17, 2, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "戦闘のサポートが得意な、心優しい少女", 4, "料理、人間観察", "トゥインクルウィッシュ");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "早見沙織", "レイ", 12, "魔族", 46, 100301, "B", 163, 18, 2, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "クールで何事にも真っ直ぐな剣士", 1, "読書、乗馬、お茶", "トゥインクルウィッシュ");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "諸星すみれ", "ミソギ", 10, "ヒューマン", 27, 100401, "O", 128, 9, 5, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "探検好きのイタズラっ子", 8, "いたずら、探検", "リトルリリカル");
