INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "浅倉杏美", "アカリ", 22, "魔族", 42, 100601, "O", 150, 13, 7, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "甘え上手なみんなの人気者", 11, "サックス", "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "雨宮天", "ミヤコ", 23, "魔族", 32, 100701, "B", 130, 14, 7, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "プリン大好きゴースト娘", 1, "プリンを食べること", "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "大空直美", "ユキ", 10, "エルフ", 40, 100801, "AB", 150, 14, 15, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "ボクは誰よりも美しい", 10, "鏡で自分を見ること", "ヴァイスフリューゲル　ランドソル支部");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "髙野麻美", "アンナ", 5, "魔族", 45, 100901, "A", 159, 17, 13, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "前世を信じる中二病患者、「疾風の冥姫」", 7, "小説執筆", "トワイライトキャラバン");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "内田真礼", "マホ", 22, "獣人族", 42, 101001, "O", 155, 16, 10, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "マホマホ王国のプリンセス", 9, "空想、ぬいぐるみ集め", "自警団（カォン）");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "阿澄佳奈", "リノ", 25, "ヒューマン", 44, 101101, "A", 156, 15, 3, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "人懐っこくてマシンガントークな妹系少女", 8, "お裁縫", "ラビリンス");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "大橋彩香", "ハツネ", 24, "エルフ", 46, 101201, "A", 156, 17, 6, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "みんなのために超能力を使う眠り姫", 12, "妹と遊ぶこと、二度寝、昼寝、早寝", "フォレスティエ");
