INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "上坂すみれ", "スズナ", 10, "魔族", 48, 101601, "O", 167, 18, 14, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "天真爛漫で人気者のカリスマモデル", 4, "ファッション", "ルーセント学院");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "高森奈津美", "カオリ", 7, "獣人族", 53, 101701, "A", 158, 19, 10, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "いつでも「なんくるないさ～」な天然娘", 7, "踊り、空手", "自警団（カォン）");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "伊藤静", "イオ", 14, "魔族", 52, 101801, "B", 162, 23, 14, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "多くの男性を魅了する無垢な女教師", 8, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", "ルーセント学院");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "日高里菜", "ミミ", 3, "獣人族", 21, 102001, "O", 117, 10, 5, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "お歌もにんじんも、ウサギさんも大好き♪", 4, "かわいいもの集め", "リトルリリカル");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "植田佳奈", "クルミ", 9, "ヒューマン", 40, 102101, "B", 150, 12, 9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "泣き虫で臆病な守ってあげたい女の子", 6, "観劇、おままごと", "サレンディア救護院");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "原紗友里", "ヨリ", 22, "魔族", 40, 102201, "O", 150, 13, 7, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "人見知りであまのじゃくな女の子", 11, "ゲーム全般", "悪魔偽王国軍（ディアボロス）");
