INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "悠木碧", "スズメ", 12, "ヒューマン", 43, 102501, "O", 154, 15, 9, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "お嬢さまのためにがんばるドジっ娘メイド", 12, "ご奉仕", "サレンディア救護院");
