INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "橋本ちなみ", "エリコ", 30, "魔族", 43, 102701, "B", 154, 16, 13, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "運命の相手に一途すぎる乙女", 7, "実験、裁縫、料理", "トワイライトキャラバン");
