INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "日笠陽子", "ノゾミ", 24, "ヒューマン", 40, 102901, "B", 157, 17, 4, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", "歌って踊れる大人気アイドル", 1, "舞台鑑賞、ダンス", "カルミナ");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "佐藤聡美", "ニノン", 31, "ヒューマン", 51, 103001, "O", 163, 16, 15, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "トーゴクの神秘、オシエテクダサイ！", 8, "忍法開発", "ヴァイスフリューゲル　ランドソル支部");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "大坪由佳", "シノブ", 22, "魔族", 42, 103101, "AB", 157, 18, 7, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "占いが得意な霊能少女", 12, "占い", "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "松嵜麗", "アキノ", 12, "ヒューマン", 45, 103201, "AB", 157, 18, 12, "この私とともにいる限り、\nお金に不自由はさせませんわ！", "一人前の商人を目指すパワフルお嬢様", 3, "慈善事業", "メルクリウス財団");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "新田恵海", "マヒル", 3, "ヒューマン", 35, 103301, "B", 142, 20, 11, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "みんなを笑顔にするお笑い牧場主", 3, "漫才", "牧場（エリザベスパーク）");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "今井麻美", "ユカリ", 16, "エルフ", 55, 103401, "A", 164, 22, 12, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "純情でほっとけない大人の女性", 3, "ウインドーショッピング", "メルクリウス財団");
