INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "花澤香菜", "アオイ", 6, "エルフ", 44, 104001, "AB", 158, 13, 6, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "「友達」に憧れる、エルフの森の女の子", 6, "友達作りのイメトレ", "フォレスティエ");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "福原綾香", "チカ", 3, "ヒューマン", 46, 104201, "O", 163, 17, 4, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "人々を守るために歌う、唱喚士の少女", 6, "各種楽器", "カルミナ");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "小松未可子", "マコト", 9, "獣人族", 54, 104301, "O", 168, 17, 10, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "男勝りで情に厚いワイルド娘", 8, "お菓子作り", "自警団（カォン）");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "丹下桜", "イリヤ", 5, "魔族", 50, 104401, "A", 172, "??", 7, "test", "かつては夜を支配した最強の吸血鬼", 5, "世界征服", "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "長妻樹里", "クウカ", 19, "ヒューマン", 49, 104501, "AB", 157, 18, 15, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "妄想大好き！　ほんとは照れ屋な女の子", 11, "小説を読むこと", "ヴァイスフリューゲル　ランドソル支部");
