INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "川澄綾子", "ジュン", 25, "ヒューマン", 50, 104701, "A", 171, 25, 8, "？？？", "素顔を見せない冷静沈着な女性騎士", 10, "格闘技、湯浴み", "王宮騎士団（NIGHTMARE）");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "田所あずさ", "ミフユ", 11, "ヒューマン", 49, 104801, "O", 163, 20, 12, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "仕事も私事も効率優先な傭兵少女", 11, "傭兵などのアルバイト", "メルクリウス財団");
