INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "久野美咲", "ミサキ", 3, "魔族", 22, 105001, "A", 120, 11, 14, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ちょっとおませな恋に恋する女の子", 1, "ファッション誌鑑賞、コスメ集め", "ルーセント学院");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "三石琴乃", "ミツキ", 7, "ヒューマン", 53, 105101, "A", 166, 27, 13, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", "実験が趣味の危険な科学者", 3, "研究、実験", "トワイライトキャラバン");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "徳井青空", "リマ", 14, "獣人族", 100, 105201, "A", 150, 18, 11, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", "乙女チックなもふもふアニマル", 3, "毛繕い、お喋り", "牧場（エリザベスパーク）");
