INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "田所あずさ", "ミフユ（サマー）", 11, "ヒューマン", 49, 108001, "O", 163, 20, 12, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "仕事も私事も効率優先な傭兵少女", 11, "傭兵などのアルバイト", "メルクリウス財団");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "大坪由佳", "シノブ（ハロウィン）", 22, "魔族", 42, 108101, "AB", 157, 18, 7, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "占いが得意な霊能少女", 12, "占い", "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "雨宮天", "ミヤコ（ハロウィン）", 23, "魔族", 32, 108201, "B", 130, 14, 7, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "プリン大好きゴースト娘", 1, "プリンを食べること", "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "久野美咲", "ミサキ（ハロウィン）", 3, "魔族", 22, 108301, "A", 120, 11, 14, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ちょっとおませな恋に恋する女の子", 1, "ファッション誌鑑賞、コスメ集め", "ルーセント学院");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "福原綾香", "チカ（クリスマス）", 3, "ヒューマン", 46, 108401, "O", 163, 17, 4, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "人々を守るために歌う、唱喚士の少女", 6, "各種楽器", "カルミナ");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "植田佳奈", "クルミ（クリスマス）", 9, "ヒューマン", 40, 108501, "B", 150, 12, 9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "泣き虫で臆病な守ってあげたい女の子", 6, "観劇、おままごと", "サレンディア救護院");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "芹澤優", "アヤネ（クリスマス）", 10, "ヒューマン", 38, 108601, "B", 148, 14, 9, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "ぷうきちといつも一緒！", 5, "屋内でできる遊び", "サレンディア救護院");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "東山奈央", "ヒヨリ（ニューイヤー）", 27, "獣人族", 44, 108701, "A", 155, 16, 2, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "人助けが大好き！　前向き格闘娘", 8, "人助け、応援", "トゥインクルウィッシュ");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "種田梨沙", "ユイ（ニューイヤー）", 5, "ヒューマン", 47, 108801, "O", 158, 17, 2, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "戦闘のサポートが得意な、心優しい少女", 4, "料理、人間観察", "トゥインクルウィッシュ");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "早見沙織", "レイ（ニューイヤー）", 12, "魔族", 46, 108901, "B", 163, 18, 2, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "クールで何事にも真っ直ぐな剣士", 1, "読書、乗馬、お茶", "トゥインクルウィッシュ");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "橋本ちなみ", "エリコ（バレンタイン）", 30, "魔族", 43, 109001, "B", 154, 16, 13, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "運命の相手に一途すぎる乙女", 7, "実験、裁縫、料理", "トワイライトキャラバン");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "生天目仁美", "シズル（バレンタイン）", 24, "ヒューマン", 54, 109101, "O", 168, 18, 3, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "お姉ちゃんがお世話してあげるからねっ！", 10, "家事全般", "ラビリンス");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "日笠陽子", "アン", 1, "ヒューマン", 55, 109201, "AB", 156, 17, "", "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", "英霊と契約を結んだマナリアの天才王女", 12, "読書", "？？？");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "こやまきみこ", "ルゥ", 4, "ヒューマン", 45, 109301, "O", 144, 15, "", "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", "マナリア魔法学院の新入生", 2, "食べること、眠ること", "？？？");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (0, "福原綾香", "グレア", 3, "半人半竜", 67, 109401, "B", 167, 17, "", "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", "人を超越した力を有す心優しい竜姫", 11, "ピアノ", "？？？");
